import './Cl.css';
import magic from './image/magic main.png'
import logo from './image/Grup.png'
import logo1 from './image/black wight.png'
import logo2 from './image/blue.png'
import logo3 from './image/jen.main.png'
import { Routes,Route,Switch,link } from 'react-router-dom';


import { Component } from "react";

class Cl  extends Component
{
 
    render(){
               
         return(
        <>  
           <div className="navbar">
             <img src={magic} className='magic'/>
                <a href="Setrvices">Services</a>
                <a href="countact us.html">Contact</a>
                <a href="About">About</a>
                <a href="">Home</a>
             </div> 
           </> )
        }   
    }
export default Cl
